column8:
こちらのポンプはフードフレッシュバッグの専用空気抜きポンプです。<br><br>
当店で販売している「真空保存容器（MPPシリーズ）」にはお使いいただけませんのでご注意ください。<br><BR>

<style>
/*買い物カゴボタン*/
#rakutenLimitedId_aroundCart input {
	width: 320px;
	height: 70px;
	background:url(http://www.rakuten.ne.jp/gold/casmin/img/common/cart_in.gif) #ff8003 no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent: 150%;
	white-space: nowrap;
	margin: 5px 0 0 0;
	display:block;
}

#rakutenLimitedId_aroundCart td.inventory {
	padding:10px 5px;
	vertical-align:middle;
	height: 2.4em;
	display:table-cell;
}

#rakutenLimitedId_aroundCart .inventory input {
	background:none !important;
	border:1px solid #cfcfcf;
	width:1.6em;
	height:1.6em;
	margin:0;
}



/*個数テキスト*/
#rakutenLimitedId_aroundCart .unit {
	font-size:16px;
}

/*個数入力*/
#rakutenLimitedId_aroundCart input#units {
	border:solid #ccc 1px;
	background:#fff!important;
	width:30px;
	height:30px;
	cursor:auto;
	padding:7px 7px 7px 3px;
	text-indent: 0px;
	overflow: hidden;
	display:inline;
	font-size:16px;
}

/*お問い合わせボタン*/
#rakutenLimitedId_aroundCart font input {
	width: 320px;
	height: 43px;
	background:url(http://www.rakuten.ne.jp/gold/casmin/img/common/contact_item.gif) #beb9b4 no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent: 150%;
	white-space: nowrap;
	margin: 5px 0 0 0;
	display:block;
}

