天然素材　快適定番<BR>
元祖亀の子束子。100年以上愛される伝統の技。<BR>
女性でも使いやすいサイズを熟考して開発された<BR>
1号サイズは、創業以来の伝統の逸品です<BR>

<P>明治４０年の発明から１００年来、その姿は変わらない手作りによる最高品質のたわしです。&lt;br&gt;<BR>
天然素材の持つ温かさと機能性を、暮らしの中で快適に演出してください。<BR>
<B><FONT size="+1">寸法：９センチｘ７．５センチｘ高さ４．５センチ</FONT></B></P>
